import { cn } from '@lib/utils';

interface IMeshGradient {
  className: string;
}

export function MeshGradient({ className }: IMeshGradient) {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      viewBox="0 0 4000 3000"
      className={cn('', className)}
    >
      <image
        id="perfume"
        xlinkHref="data:image/webp;base64,"
      />
    </svg>
  );
}
